<meta charset="UTF-8">
<meta name="viewport" content="initial-scale=1.0, user-scalable=no">
<title>Google Maps API GeoJSON(ポイント)読み込み</title>
<style type="text/css">
html, body, #map-canvas {
height: 100%;
margin: 0px;
padding: 0px
}
</style>
<script type="text/javascript" src="Google%20Maps%20API%20GeoJSON%28%E3%83%9D%E3%82%A4%E3%83%B3%E3%83%88%29%E8%AA%AD%E3%81%BF%E8%BE%BC%E3%81%BF_files/js" style=""></script>
<script src="Google%20Maps%20API%20GeoJSON%28%E3%83%9D%E3%82%A4%E3%83%B3%E3%83%88%29%E8%AA%AD%E3%81%BF%E8%BE%BC%E3%81%BF_files/d3.js"></script>
<script>
google.maps.event.addDomListener(window, 'load', function() {
	
	//Google Maps初期化
	var map = new google.maps.Map(document.getElementById('map-canvas'), {
		center: { lat: 36.3894816, lng: 139.0634281 },
		zoom: 12
	});

	
	//マーカーのスタイルを指定
	var styleFeature = function(feature) {
		return {
			icon: {
				path: google.maps.SymbolPath.CIRCLE,
				scale:  ~~(Math.random() * 20), //円のサイズ(今回はランダムに設定)
				fillColor: '#f00',
				fillOpacity: 0.35,
				strokeWeight: 0
			}
		};
	};
	
	//GeoJSONデータ読み込み
	d3.json('aed.geojson', function(data) {		
		//データレイヤーに追加
		map.data.addGeoJson(data);
		//データレイヤのスタイルを指定
		map.data.setStyle(styleFeature);
		//イベント(マーカークリック時)を設定
		map.data.addListener('click', mouseClick);
	});
	
	function mouseClick(e) {
		//features->propertiesのaddressデータをクリック時に表示する
		alert(e.feature.getProperty('address'));	
	}
   
});



</script>
